import './App.css';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router , Route} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">

    <Route path="/" element={ <Home/> } />
   <Route path="/checkout">
      <Header/>
      <h1>i am checkout</h1>
      </Route>
      <Route path="/">
      <Header/>
      <Home/>
      </Route>

    </div>
    </Router>
  );
}

export default App;
